  这样做 router 实例既能在通过 context 向下传递，又能通过下级对象的 props 传递
  但是这种方法有一个缺陷，就是 router 对象又被限制在了一个容器对象中，假如作为容器的对象本身也是嵌套在了另一个容器中，而作为上级容器也要控制路由跳转，这样还是存在 router 对象不能直接获取问题，不如 redux 共享灵活
